//https://getbootstrap.com/docs/4.0/components/forms/
import React, { Component } from "react";
import CustSearchForm from "../../components/CustSearchForm/CustSearchForm";
import RenderMap from "../../components/RenderMap/RenderMap";
import Geocode from "react-geocode";
import Geocoder from "react-native-geocoding";
import { GoogleComponent } from "react-google-location";
Geocode.setApiKey("AIzaSyDppxNKV5QddpqA90IuS0kWg9HTLOuJsGw");
Geocode.init("AIzaSyDppxNKV5QddpqA90IuS0kWg9HTLOuJsGw");
Geocode.setLanguage("en");

export default class CustVendorSearch extends Component {
  constructor(props) {
    super(props);
    this.state = {
      place: null,
    };
  }

  render() {
    return (
      <>
        <CustSearchForm />
        <div>
          <GoogleComponent
            apiKey={"AIzaSyDppxNKV5QddpqA90IuS0kWg9HTLOuJsGw"}
            language={"en"}
            country={"country:in|country:us"}
            coordinates={true}
            locationBoxStyle={"custom-style"}
            locationListStyle={"custom-style-list"}
            onChange={(e) => {
              this.setState({ place: e });
            }}
          />
        </div>
        <RenderMap />
      </>
    );
  }
}
